entries.desc:
type t = {
  scheme : string;
  authority : string;
  path : string;
  query : string option;
  fragment : string option;
}

type t = {
  scheme : string;
  authority : string;
  path : string;
  query : string option;
  fragment : string option;
}

value:
(match if not (String.is_empty authority)
      then
        (let s = String.lowercase_ascii authority in
         Buffer.add_string buff (encode ?allow_slash:None s));
      if not (String.is_empty path)
      then
        (let encode = encode ?allow_slash:(Some true) in
         let encoded_colon = "%3A" in
         let len = String.length path in
         if (len >= 3) && (((path.[0]) = '/') && ((path.[2]) = ':'))
         then
           let drive_letter = Char.lowercase_ascii (path.[1]) in
           (if (drive_letter >= 'a') && (drive_letter <= 'z')
            then
              (Buffer.add_char buff '/';
               Buffer.add_char buff drive_letter;
               Buffer.add_string buff encoded_colon;
               (let s = String.sub path ~pos:3 ~len:(len - 3) in
                Buffer.add_string buff (encode s))))
         else
           if (len >= 2) && ((path.[1]) = ':')
           then
             (let drive_letter = Char.lowercase_ascii (path.[0]) in
              if (drive_letter >= 'a') && (drive_letter <= 'z')
              then
                (Buffer.add_char buff drive_letter;
                 Buffer.add_string buff encoded_colon;
                 (let s = String.sub path ~pos:2 ~len:(len - 2) in
                  Buffer.add_string buff (encode s))))
           else Buffer.add_string buff (encode path));
      (match query with
       | None -> ()
       | Some q ->
           (Buffer.add_char buff '?';
            Buffer.add_string buff (encode ?allow_slash:None q)));
      (match fragment with
       | None -> ()
       | Some f ->
           (Buffer.add_char buff '#';
            Buffer.add_string buff (encode ?allow_slash:None f)));
      Buffer.contents buff
with
| "" -> _
| _ -> _)

